window.bookSummaryJSON = "<p><b>The highly anticipated sequel to the beloved worldwide best seller </b><b><i>Ready Player One</i></b><b>, the near-future adventure that inspired the blockbuster Steven Spielberg film. </b></p> <p><b>An unexpected quest. Two worlds at stake. </b><b><i>Are you ready? </i></b></p> <p>Days after winning OASIS founder James Halliday’s contest, Wade Watts makes a discovery that changes everything.&nbsp;</p> <p>Hidden within Halliday’s vaults, waiting for his heir to find, lies a technological advancement that will once again change the world and make the OASIS 1,000 times more wondrous - and addictive - than even Wade dreamed possible.</p> <p>With it comes a new riddle, and a new quest - a last Easter egg from Halliday, hinting at a mysterious prize.</p> <p>And an unexpected, impossibly powerful, and dangerous new rival awaits, one who’ll kill millions to get what he wants.</p> <p>Wade’s life and the future of the OASIS are again at stake, but this time the fate of humanity also hangs in the balance.</p> <p>Lovingly nostalgic and wildly original as only Ernest Cline could conceive it, <i>Ready Player Two</i> takes us on another imaginative, fun, action-packed adventure through his beloved virtual universe, and jolts us thrillingly into the future once again.</p>"; 
